import axios from "axios";
import { useState, useEffect, useRef } from "react";
import Cookies from 'js-cookie';

export function Chats() {
    const [friendData,setFriend] = useState([]);
    useEffect(()=>{
        axios.get(`http://127.0.0.1:8000/api/v1/friends/your_friend/?your_id=${Cookies.get('user_id')}`)
        .then(response => {
            setFriend(response.data);
            console.log(response.data);
        })
        .catch(error => {
            console.error(error);
        });
    },[]);
    const [allUsersData,setUsers] = useState([]);
    useEffect(()=>{
        axios.get(`http://127.0.0.1:8000/api/v1/users/exclude_ids/?exclude_ids=${Cookies.get('user_id')}`)
        .then(response=>{
            setUsers(response.data);
            console.log(response.data);
        })
    })
    return(
        <>
            <div className="user_list">
                {allUsersData.map((item)=>{
                    return(
                    <div className="potential_friend">
                        <img src="" alt="" />
                        <span>{item.f}</span>
                        <button>add</button>
                    </div>
                    );
                })}
            </div>
        </>
    )
    
}
